        [color=black][bold]
                                WEAPON RENTAL NOTICE
                                                  Form 6594-Y[/bold]
        


        [head=1]NanoTrasen Security Department[/head]


        [head=2]Notice of Weapon Rental for Training Purposes[/head]


        This notice serves as a reminder that the NanoTrasen Corporation provides weapon rental services to its Security Department for authorized [italic]training purposes only[/italic]. Please carefully review the following guidelines to ensure compliance:


        [head=3]Rental Conditions[/head]

        [bullet] Weapons are issued [bolditalic]exclusively[/bolditalic] for use in designated training areas.

        [bullet] [bolditalic]Under no circumstances[/bolditalic] should rented weapons be brought onto the station or used outside of approved training sessions.

        [bullet] All weapons must be returned immediately after training concludes.


        [head=3]Return Protocol[/head]

        [bullet] Weapons must be cleaned, inspected, and returned to the armory by the end of the training session.

        [bullet] Failure to return weapons in a timely manner will result in disciplinary action.


        [head=3]Authorization & Compliance[/head]

        [bullet] Only authorized personnel with the appropriate clearance may rent and use training weapons.

        [bullet] Compliance with these protocols is mandatory. Violations will be reported to upper management and may impact future security operations.


        For any questions or further clarification, please contact the HR Department or the Chief Security Officer.


        [bold]NanoTrasen Corporation[/bold]

        Ensuring your safety, one protocol at a time.
